const getApi = () => {
  return fetch(
    "https://raw.githubusercontent.com/Adalab/rick-y-morty/master/data/rick-y-morty.json"
  )
    .then((response) => response.json())
    .then((data) => {
      return data.results.map((data) => {
        return {
          id: data.id,
          name: data.name,
          status: data.status,
          species: data.species,
          image: data.image,
        };
      });
    });
};

export default getApi;
